import { combineReducers } from "redux";
import signUpReducer from "./signUpReducer";


const rootReducer = combineReducers({
  signUpReducer,
  logReducer,
  profileReducer,
  roomsReducer,
  adminPanelReducer,
  tournamentsReducer,
  editProfileReducer,
  rankingReducer,
});

export default rootReducer;
